import logo from "../images/F-logo.png";

export default function SideBar() {
  return (
    <div>
      <div className="S">
        <div className="S-1">
          <img src={logo}></img>
        </div>

        <div className="S-2">

        </div>

        <div className="S-3">

        </div>
      </div>
    </div>
  );
}
